'''
Given a string, s, containing an RNA sequence, return the protein
encoded by string s.

Approach:
First create dictionaries for each codon sequence.
Then need to parse RNA string in groups of 3 nucleotides.
To do so, will have to split RNA string by index and append each element
to a list. 
Then, iterate through list, matching each element to the dictionary,
and appending the result into a new list, protein_string. 
Append protein_string until the stop codon is met

Pseudocode:
# Define codon dictionary first
rna_protein_dictionary = {spam: eggs} # spam = RNA codon, eggs = peptide
# Create codon list from rna_string and convert codon to peptide chain
define function (rna_string):
    rna_codons = []
    peptide_chain = []
    index_to_split = 3
    for index in range 0:length(rna_string), in increments of index_to_split:
        append rna_string[index to index + index_to_split] to rna_codons
    
    # Convert codon to peptide
    for codon in rna_codon:
        append rna_protein_dictionary[codon] to peptide_chain
        if peptide_chain[-1] == "Stop":
            break
    
    return peptide_chain
'''

