def translate_rna_to_peptide_chain(rna_string):
    rna_codons = []
    peptide_chain = []
    index_to_split = 3
    # Create a list of codons
    for index in range(0, len(rna_string), index_to_split):
        rna_codons.append(rna_string[index:index + index_to_split])
    
    # Convert codon to peptide
    for codon in rna_codons:
        if rna_protein_dictionary[codon] != "Stop":
            peptide_chain.append(rna_protein_dictionary[codon])
        else:
            break
    
    result = "".join(peptide_chain)
    
    return print(result)

